    <script>document.addEventListener('DOMContentLoaded', function() {
    const slider = document.getElementById('routeSlider');
    // If there is only one route (max â‰¤ 1), replace the slider and the "Show All Routes" checkbox
    if (slider && parseInt(slider.getAttribute('max')) <= 1) {
        const sliderContainer = document.getElementById('sliderContainer');
        sliderContainer.innerHTML = `
            <div style="text-align: center;">Only one route is available,<br>selection is not possible.</div>
            <br>
            <input type="checkbox" id="toggleShadow" checked onchange="updateRoutes()">
            <label for="toggleShadow">Show Shadows</label>
        `;
        // Update routes, forcing showAllRoutes to false
        updateRoutes();
    }
});

function updateRoutes() {
    const slider = document.getElementById('routeSlider');
    // If the "showAllRoutes" checkbox does not exist, simulate it as unchecked (false)
    let showAll = document.getElementById('showAllRoutes');
    if (!showAll) {
        showAll = { checked: false };
    }
    const toggleShadow = document.getElementById('toggleShadow');
    // If the slider does not exist (single route), use 0 by default
    const selectedRoute = slider ? slider.value : 0;
    // Get all path elements from the map
    const paths = document.querySelectorAll('path');
    let routeIndex = 0;
    paths.forEach(path => {
        const stroke = path.getAttribute('stroke');
        // If the path is a route (stroke is not black)
        if (stroke && stroke.toLowerCase() !== '#000000' && stroke.toLowerCase() !== 'black') {
            if (showAll.checked) {
                path.style.display = '';
            } else {
                path.style.display = (routeIndex == selectedRoute) ? '' : 'none';
            }
            routeIndex++;
        } else {
            // For shadows (black stroke), check the state of the shadow checkbox
            path.style.display = toggleShadow.checked ? '' : 'none';
        }
    });
    if (!showAll.checked) {
        // Force the info container to be displayed so its offsetWidth is calculated correctly
        const infoDiv = document.getElementById('timeInfo');
        if (infoDiv) {
            infoDiv.style.display = 'block';
        }
        // Update the information in the next frame to ensure the layout is updated
        window.requestAnimationFrame(() => {
            updateTimeInfo(selectedRoute, showAll.checked);
        });
    } else {
        hideTimeInfo();
    }
}

function sliderChanged() {
    // When the slider changes, deactivate "Show All Routes" if it exists
    const showAllEl = document.getElementById('showAllRoutes');
    if (showAllEl) {
       showAllEl.checked = false;
    }
    updateRoutes();
}</script>

    <script>function updateTimeInfo(selectedIndex, showAllRoutes) {
    if (typeof routeTimes === 'undefined') return;
    const infoDiv = document.getElementById('timeInfo');
    if (!infoDiv) return;

    const routeData = routeTimes[selectedIndex];
    if (!routeData) {
        infoDiv.style.display = 'none';
        return;
    }

    // Values of the selected route
    const shadow = routeData.time_shadow;
    const sun = routeData.time_sun;
    const total = shadow + sun;

    // Always use global maximums to keep bars the same size
    const maxShadow = Math.max(...routeTimes.map(r => r.time_shadow));
    const maxSun = Math.max(...routeTimes.map(r => r.time_sun));

    // Use the total width of the container (the gray bar) as a reference
    const timeBar = document.getElementById('timeBar');
    const totalWidth = timeBar.offsetWidth;

    // Calculate the scaling factor using the global maximums
    const scale = totalWidth / (maxShadow + maxSun);

    // The origin is located at the center of the bar based on the maximums
    const origin = (maxShadow / (maxShadow + maxSun)) * totalWidth;

    const shadowSegment = document.getElementById('timeShadowSegment');
    const sunSegment = document.getElementById('timeSunSegment');
    const divider = document.getElementById('timeDivider');

    // Configure the Shadow segment
    const shadowWidth = shadow * scale;
    shadowSegment.style.width = shadowWidth + 'px';
    // Position its right end at the origin
    shadowSegment.style.left = (origin - shadowWidth) + 'px';
    shadowSegment.textContent = shadow ? shadow + ' min' : '';

    // Configure the Sun segment
    const sunWidth = sun * scale;
    sunSegment.style.width = sunWidth + 'px';
    sunSegment.style.left = origin + 'px';
    sunSegment.textContent = sun ? sun + ' min' : '';

    // Position the divider at the origin
    divider.style.left = origin + 'px';
    divider.style.transform = 'none';

    // Display the total at the bottom
    const totalTimeDiv = document.getElementById('totalTime');
    totalTimeDiv.textContent = total ? 'Total min: ' + total : '';

    infoDiv.style.display = 'block';
}

function hideTimeInfo() {
    const infoDiv = document.getElementById('timeInfo');
    if (infoDiv) {
        infoDiv.style.display = 'none';
    }
}</script>
